import React from 'react'

const ElementoMenu = (datos) => {
  return (
    <li>
      <div className='menuselecelement'>
          <p>{datos.nombreMenu}</p>
          <p>{datos.tipoMenu}</p>
          <p>{datos.precio}</p>
      </div>
    </li>
  )
}

export default ElementoMenu
